import React, { Component } from'react';

class Child extends React.Component{

  delete(id){
    this.props.delete(id);
  }

render() {
    return (
        <ul>
            {this.props.items.map(item => (
                <li key={item.id}>
                  {item.text}
                  <button onClick={this.delete.bind(this)}>Delete</button>
                </li>
            ))}
        </ul>
    );
}
}

export default Child;
